import React from "react";
import { Dialog } from "@mui/material";
function Modal(open, closeDialogue) {
  return (
    <Dialog
      fullWidth
      open={open}
      maxWidth="md"
      scroll="body"
      onClose={closeDialogue}
      onBackfropClick={closeDialogue}
    ></Dialog>
  );
}

export default Modal;
